script: |
  super -f text -I q3667.spq | sort > q3667.out

inputs:
  - name: q3667.spq
    data: |
      SELECT DISTINCT col2 AS col1 FROM tab1 (FORMAT parquet) WHERE ( - 25 - + col2 + + col2 + + col1 * ( 54 ) + + col0 * col2 ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q3667.out
    data: |
      59
      68
      96
